import React from "react"
import {TopHeader} from "./TopHeader"
import {useTranslation} from '../../../../i18n'

export const TopHeaderContainer = (props) => {
    const {t} = useTranslation();
    return (
        <TopHeader t={t} local={props.local}/>
    )
}
